pub fn longest_dup_substring_rk(s: String) -> String {
    use std::collections::{HashMap, HashSet};

    if s.len() < 2 {
        return "".to_string()
    }

    fn core(s: &str, chars: &Vec<u32>, k: usize) -> Option<String> {
        const Q: u32 = (1 << 26) - 1;
        const BIT: u32 = 5;
        let b: u32 = {
            let mut b = 1;
            for _ in 0..k {
                b <<= BIT;
                b %= Q;
            }
            b
        };
        let hash = &chars[..k].iter().fold(0, |acc, &x| (acc << BIT) % Q + x);
        let mut hash = hash.clone();

        let mut hashmap = HashMap::<u32, HashSet<usize>>::new();
        let mut set = HashSet::<usize>::new();
        set.insert(0);
        hashmap.insert(hash, set);

        for i in 1..=s.len()-k {
            hash <<= BIT;
            hash %= Q;
            hash += Q - (chars[i-1] * b) % Q + chars[i+k-1];
            hash %= Q;
            match hashmap.get_mut(&hash) {
                None => {
                    let mut set1 = HashSet::<usize>::new();
                    set1.insert(i);
                    hashmap.insert(hash, set1);
                },
                Some(set) => {
                    for j in set.iter() {
                        let j = j.clone();
                        if &s[i..i+k] == &s[j..j+k] {
                            return Some((&s[i..i+k]).to_string())
                        }
                    }
                    set.insert(i);
                },
            }
        }
        None
    }

    let mut min = 1;
    let mut max = s.len()-1;
    let mut last = "".to_string();
    let chars: Vec<u32> = s.chars().map(|x| (x as u32) - ('a' as u32) + 1).collect();
    while max >= min {
        let k = (min+max) / 2;
        match core(s.as_str(), &chars, k) {
            None => max = k - 1,
            Some(longest) => {
                last = longest;
                min = k + 1;
            },
        }
    }
    last
}

pub fn longest_dup_substring_kmp(s: String) -> String {
    if s.len() < 2 {
        return "".to_string()
    }

    fn core(s: &str, chars: &Vec<char>, chance_table: &mut Vec<bool>, k: usize) -> Option<String> {
        for i in 0..s.len()-k {
            if !chance_table[i] {
                continue
            }
            let n_vec = &chars[i..i+k];
            let failure_table = {
                let mut table: Vec<i32> = vec![-1; k];
                for i in 1..k {
                    if i == 1 {
                        table[i] = 0;
                        continue
                    }
                    if i == 2 {
                        if n_vec[0] == n_vec[1] {
                            table[i] = 1;
                        } else {
                            table[i] = 0;
                        }
                        continue
                    }
                    let mut lsp = table[i-1];
                    while lsp >= 0 {
                        if n_vec[lsp as usize] == n_vec[i-1] {
                            break;
                        } else {
                            lsp = table[lsp as usize];
                        }
                    }
                    table[i] = lsp + 1;
                }
                table
            };

            let mut m = 0;
            let mut j = 0;

            let h_vec = &chars[i+1..];
            while j+m < h_vec.len() {
                if j == k {
                    return Some((&s[i..i+k]).to_string())
                }
                if h_vec[j+m] == n_vec[j] {
                    j += 1;
                    if j == k {
                        return Some((&s[i..i+k]).to_string())
                    }
                    continue
                } else {
                    match failure_table[j] {
                        -1 => m += 1,
                        t => {
                            m += j - t as usize;
                            j = t as usize;
                        },
                    }
                }
            }
            chance_table[i] = false;
        }
        None
    }

    let mut last = "".to_string();
    let chars: Vec<char> = s.chars().collect();
    let mut chance_table = vec![true; s.len()];
    for k in 1..s.len() {
        println!("Searching {}...", k);
        match core(s.as_str(), &chars, &mut chance_table, k) {
            None => break,
            Some(longest) => last = longest,
        }
    }
    last
}

#[test]
fn test_longest_dup_substring() {
    let l = |s: &str| longest_dup_substring_rk(s.to_string());
    assert_eq!(l("\
"), "aeeebaabd");
    assert_eq!(l("\
"), "mqqqv");
    assert_eq!(l("\
"), "bbaababaabbbbaabaaaababbbabbbb");
    assert_eq!(l("banana"), "ana");
    assert_eq!(l("abcd"), "");
    assert_eq!(l("aaaaa"), "aaaa");
}